import {Link} from "react-router-dom";

const SellerHeader = () =>{
    return(
        <div className="container mt-4">
    <div className="row">
        <div className="col-lg-3">
            <h1 className="text-danger"> <i className="fa fa-shopping-bag"></i>Seller app</h1>
        </div>
        <div className="col-lg-9 text-end">
            <div className="btn-group">
                <Link className="btn btn-danger"><i className="fa fa-home" to="/"></i> Dashboard </Link>
                <Link className="btn btn-info"><i className="fa fa-table" to="/productlist"></i> All Items </Link>
                <button className="btn btn-primary"><i className="fa fa-plus" to="/newproduct"></i> Add Item </button>
                <Link className="btn btn-success"><i className="fa fa-headset" to="/order"></i> Order List </Link>
                <button className="btn btn-warning"> Welcome - {localStorage.getItem("fullname") } Logout <i className="fa fa-power-off"></i>  </button>
            </div>
        </div>
        </div>
    </div>
    )
}

export default SellerHeader;

const logout = () =>{
    localStorage.clear();
}
